import React from "react";
import film from "../media/film.jpg";
import movie_db from "../media/the_movie_db.svg";

const Home = () => {

    return (
        <div className="home">
            <a href="https://www.themoviedb.org/" target="_blank">
                <img style={{ width: "10%", marginRight: "20px" }} src={movie_db} alt="The Movie Database" />
            </a>
            <img src={film} alt="picture home" />
            <a href="https://www.themoviedb.org/" target="_blank">
                <img style={{ width: "10%", marginLeft: "20px" }} src={movie_db} alt="The Movie Database" />
            </a>
        </div>
    )
}
export default Home;
